// components/Header.js
import React, { useState } from 'react';

const Header = ({ user, onLoginClick, onSignupClick, onLogout }) => {
  const [activeLink, setActiveLink] = useState('Buy');

  const navLinks = [
    { name: 'Buy', icon: 'fas fa-home' },
    { name: 'Rent', icon: 'fas fa-key' },
    { name: 'Sell', icon: 'fas fa-dollar-sign' },
    { name: 'Tools', icon: 'fas fa-tools' },
    { name: 'Advertise', icon: 'fas fa-bullhorn' },
    { name: "What's New", icon: 'fas fa-newspaper' },
    { name: 'HomeLoans Blog', icon: 'fas fa-blog' },
    { name: 'Help', icon: 'fas fa-question-circle' }
  ];

  return (
    <header className="header">
      <div className="container">
        <div className="header-top">
          <a href="#" className="logo">Magic<span>Bricks</span></a>
          <div className="user-actions">
            {user ? (
              <div className="user-welcome">
                <span>Welcome, {user.name}</span>
                <button className="btn btn-logout" onClick={onLogout}>Logout</button>
              </div>
            ) : (
              <>
                <button className="btn btn-login" onClick={onLoginClick}>
                  <i className="fas fa-user"></i> Login
                </button>
                <button className="btn btn-signup" onClick={onSignupClick}>Sign Up</button>
              </>
            )}
          </div>
        </div>
        
        <div className="header-nav">
          <nav className="main-nav">
            {navLinks.map(link => (
              <a 
                key={link.name}
                href="#" 
                className={`nav-link ${activeLink === link.name ? 'active' : ''}`}
                onClick={(e) => {
                  e.preventDefault();
                  setActiveLink(link.name);
                }}
              >
                <i className={link.icon}></i> {link.name}
              </a>
            ))}
          </nav>
          
          <div className="search-box">
            <input type="text" placeholder="Search properties, locations..." />
            <button className="search-btn"><i className="fas fa-search"></i></button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
